            <Article
              imgUrl={blog02}
              date="Sept 26, 2025"
              title="GPT-3 and Open  AI is the future. Let us exlore how it is?"
            />
            <Article
              imgUrl={blog03}
              date="Sept 26, 2025"
              title="GPT-3 and Open  AI is the future. Let us exlore how it is?"
            />
            <Article
              imgUrl={blog04}
              date="Sept 26, 2025"
              title="GPT-3 and Open  AI is the future. Let us exlore how it is?"
            />
            <Article
              imgUrl={blog05}
              date="Sept 26, 2025"
              title="GPT-3 and Open  AI is the future. Let us exlore how it is?"
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Blog;
